(193, '\"It rarely happens, when an obscurd thing guides your soul. But, it happens everytime between you and me, we communicate through sensations and we share the closest bond. Yet your eyes will never get a glimpse of me. Only thing you can do is to express me. Without me your body is a carcass which is why I make you lay in bed with all the moments and memories creeping up your brain, make you stare and stand in the shower for countless period of time and seperate you from rest of the crowd just to make you more \"human\" but these situations are more for you then for me, giving time for yourself. ', 'white and black polka dot textile on window', 'https://images.unsplash.com/photo-1611490358117-70a2c5d017c8?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MXwxMjg3NDl8MHwxfHJhbmRvbXx8fHx8fHx8&ixlib=rb-1.2.1&q=80&w=400', 'https://images.unsplash.com/photo-1611490358117-70a2c5d017c8?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MXwxMjg3NDl8MHwxfHJhbmRvbXx8fHx8fHx8&ixlib=rb-1.2.1&q=80&w=1080', 39, '2021-01-24 07:13:51', 'QGVrSXB9ydY', 1938, 'Safal Karki');
