(204, 'Photography has a big place in my life. Before making it my profession, it\'s above all my passion, my means of expression, my escape when I\'m a bit moody. Hence the slightly melancholic atmosphere of my universe. What\'s good about art is that it\'s very vast. Painting, music, cinema are inspirations. Since my teenage years, thanks to my artistic journey, I have had the chance to meet and discover different artists and artistic movements. Visiting museums, exhibitions, being curious about what others do, why they do it. Follow me on Instagram for more content @15juillet', 'snow covered mountains under blue sky during daytime', 'https://images.unsplash.com/photo-1610361865487-b35d98a74a5e?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MXwxMjg3NDl8MHwxfHJhbmRvbXx8fHx8fHx8&ixlib=rb-1.2.1&q=80&w=400', 'https://images.unsplash.com/photo-1610361865487-b35d98a74a5e?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MXwxMjg3NDl8MHwxfHJhbmRvbXx8fHx8fHx8&ixlib=rb-1.2.1&q=80&w=1080', 297, '2021-01-11 05:45:03', 'NE6cZGd_A_A', 7142, 'Corentin Hais'),
